import React from 'react';
import { SafeAreaView, StyleSheet, Text, View, Image, TextInput } from 'react-native';
import SubmitButton from '../../components/general/submitButton'
import { Icon } from 'react-native-elements'
import LabelInput from '../../components/labelInput/labelInput';

export default function SignUp() {
    return (
        <SafeAreaView style={styles.container}>
            <View style={styles.logoContainer}>
                <Icon 
                    name='chevron-left'
                    style={styles.back}
                    size={50}
                    color= '#707070'
                />
                <Image
                    style={styles.logo}
                    source={require('../../../assets/favicon.png')}
                />
            </View>
            <View style={styles.register}>
                <Text style={styles.registerText}>Register</Text>
            </View>
            <View style={styles.form}>
                <LabelInput text="Username"/>
                <LabelInput text="Email"/>
                <LabelInput text="Password"/>
                <LabelInput text="Password Again"/>
            </View>
            <View style={styles.submit}>
                <SubmitButton text="SIGN UP"></SubmitButton>
            </View>
        </SafeAreaView>
    )
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#F2F2F2',
    },
    back: {
        alignSelf: 'flex-start',
    },
    logoContainer: {
        flex: 2,
        justifyContent: 'center'
    },
    logo: {
        width: 50,
        height: 50,
        alignSelf: 'center'
    },
    register: {
        flex: 1,
    },
    registerText: {
        marginLeft: 15
    },
    form:{
        flex: 5
    },
    formText:{
        marginLeft: 20,
        marginTop: 20
    },
    box: {
        backgroundColor: 'white',
        borderRadius: 18,
        width: 369,
        height: 43,
        alignSelf: 'center',
        marginTop: 10
    },
    submit: {
        flex: 2
    }
});
